    false,nt"url": null,nt"notes": "This narrative report for Talcot Lake NWR
    outlines Refuge accomplishments from September through December of 1942. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, and furbearers-
    is also covered. Resource management is outlined; topics include fur harvesting
    and timber removal. The public relations section of the report describes Refuge
    visitors, hunting, and fishing. N-R forms are attached.",nt"license_title":
